Hi Lee! From your description, it sounds like some game files became corrupted. Please try following these steps in order to fix it: 
- Go to your application manager and select The Game of Life;
- Press Storage;
- Clear Data and Cache for Google Play and Google Play Services as well
- Restart your phone. or please contact help@marmalademail.com.

It sounds like the game files were corrupted during installation. Please, could you follow these steps to try and fix the issue?
1. Go to your application manager and select The Game of Life;
2. Press Storage;
3. Clear Data and Cache;
4. Uninstall The Game of Life;
5. Restart your phone;
6. Install The Game of Life and try to open it again.

